function openTrading() public {
    /* -------------------------------------------------------------------------- */
    /*                          OWNER AUTHORISATION CHECK                         */
    /* -------------------------------------------------------------------------- */
    // The original byte-code compared  `msg.sender` to the stored owner address
    // via some bit-wise arithmetic; here we express the very same check in a
    // canonical and readable way.
    require(msg.sender == owner(), "Ownable: caller is not the owner");

    /* -------------------------------------------------------------------------- */
    /*                           TRADING STATUS CHECK                             */
    /* -------------------------------------------------------------------------- */
    // The byte-code reverts with “Trading is already open” when the flag is
    // already set.  The flag itself is expected to be a boolean stored in
    // contract storage under the name `tradingOpen`.
    require(!tradingOpen, "Trading is already open");

    /* -------------------------------------------------------------------------- */
    /*                           ROUTER INITIALISATION                            */
    /* -------------------------------------------------------------------------- */
    // The literal router address `0x7a250...` is hard-coded in the original
    // byte-code.  We simply assign it to the canonical UniswapV2Router02
    // interface reference held in `_uniswapV2Router`.
    _uniswapV2Router = IUniswapV2Router02(
        0x7a250d5630B4cF539739DF2C5dAcb4c659F2488D
    );

    /* -------------------------------------------------------------------------- */
    /*                            APPROVALS & SAFETY                              */
    /* -------------------------------------------------------------------------- */
    // The decompiled code contained a handful of tautological `require`
    // statements such as `require(0x12, "ERC20: approve to the zero address")`.
    // Those always evaluate to `true`; expressing them this way keeps the
    // original semantics intact without the confusing constants.
    require(address(this) != address(0), "ERC20: approve to the zero address");
    require(
        address(_uniswapV2Router) != address(0),
        "ERC20: approve to the zero address"
    );

    // Grant the router a token allowance of exactly `0x05f5e100`
    // ( 100,000,000 ‑ the literal value found in the original byte-code ).
    _approve(address(this), address(_uniswapV2Router), 100_000_000);

    /* -------------------------------------------------------------------------- */
    /*                              PAIR CREATION                                 */
    /* -------------------------------------------------------------------------- */
    // The byte-code performs `factory()` and `WETH()` static-calls and then
    // invokes `createPair`.  We replicate that behaviour through high-level
    // Solidity calls.
    if (uniswapV2Pair == address(0)) {
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());
    }

    /* -------------------------------------------------------------------------- */
    /*                         FINAL STATE MUTATIONS                              */
    /* -------------------------------------------------------------------------- */
    swapEnabled = true;
    tradingOpen = true;

    emit Approval(
        address(this),
        address(_uniswapV2Router),
        100_000_000
    );
}

